import './ShowResults.css';

const ShowResults = (props) => {
	// console.log(props.distance);
	console.log(props.fuelCost);
	console.log(props.dayCost);
	console.log(props.numberOfDays);
	// console.log(props.numberOfYear);
	console.log(props.category)
	const petrolCost = props.userData.distance * props.fuelCost;
	const costAllDays = props.numberOfDays * props.dayCost;
	const years = new Date().getFullYear() - props.userData.year;
	console.log(years);
	if(years < 5){
		console.log(5*1.6)
	}
	else{
		console.log(5)
	}
	console.log(years);

	return (
		<div>
			<h1>
				Łączny koszt wynajmu: {parseFloat(props.distance) * props.fuelCost}
			</h1>
			<ul>
				<li>Koszt paliwa: {petrolCost} </li>
				<li>Koszt spowodowany liczbą dni wypożyczenia: {costAllDays}</li>
				<li>
					Koszt spowodowany czasem posiadania prawa jazdy:
					{parseFloat(props.distance) * props.fuelCost}
				</li>
				<li>
					Koszt marką samochodu: {parseFloat(props.distance) * props.fuelCost}
				</li>
				<li>
					Koszt liczbą modeli samochodu:
					{parseFloat(props.distance) * props.fuelCost}
				</li>
				<li>Koszt netto: {parseFloat(props.distance) * props.fuelCost} </li>
				<li>Koszt brutto: {parseFloat(props.distance) * props.fuelCost} </li>
			</ul>
			<button onClick={props.Change}>Wróć</button>
		</div>
	);
};

export default ShowResults;
